import './topbar.css';

export default function topbar() {
	return (
		<div className="top">
			<div className="topLeft">
				<i class="fa-brands fa-instagram-square"></i>
			</div>
			<div className="topCenter">C</div>
			<div className="topRight">R</div>
		</div>
	);
}
